import logo from './logo.svg';
import './App.css';
import {Container } from '@mui/material';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Container>
        <Header/>
      </Container>
      </header>
    </div>
  );
}

export default App;
